  return (
    <div className="login">
      <label>Login</label>
      <input
        placeholder="Username"
        onChange={(event) => {
          setUser({ ...user, userName: event.target.value });
        }}
      />
      <input
        placeholder="Password"
        onChange={(event) => {
          setUser({ ...user, passWord: event.target.value });
        }}
      />

      <button onClick={login}>Login</button>
    </div>
  );
}
export default Login;
